fn sum_list(head: Option<&Node>) -> i32 { let mut sum = 0; let mut current = head; while let Some(node) = current { sum += node.value; current = node.next.as_deref(); } sum
} #[test]
fn test_sum_list() { let node2 = Box::new(Node { value: 30, next: None }); let node1 = Box::new(Node { value: 20, next: Some(node2) }); let head = Node { value: 10, next: Some(node1) }; assert_eq!(sum_list(Some(&head)), 60); assert_eq!(sum_list(None), 0);
} What Changed : while (current != NULL)  while let Some(node) = current current = current->next  current = node.next.as_deref() Pattern matching for safe null handling

